CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_list_products` AS select `products`.`id` AS `id`,`products`.`code` AS `code`,`products`.`name` AS `name`,`product_categories`.`name` AS `category_name`,`product_brands`.`name` AS `brand_name`,`products`.`product_cost` AS `product_cost`,`products`.`product_price` AS `product_price`,`products`.`qty_onhand` AS `qty_onhand`,`products`.`description` AS `description` from ((`products` join `product_categories` on((`product_categories`.`id` = `products`.`category_id`))) join `product_brands` on((`product_brands`.`id` = `products`.`brand_id`))) ;

-- ----------------------------
-- View structure for `view_list_product_sales`
-- ----------------------------
DROP VIEW IF EXISTS `view_list_product_sales`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_list_product_sales` AS select `products`.`id` AS `id`,`products`.`name` AS `name`,`product_categories`.`name` AS `category_name`,`product_brands`.`name` AS `brand_name`,format(`products`.`product_cost`,2) AS `product_cost`,format(`products`.`product_price`,2) AS `product_price`,`products`.`qty_onhand` AS `qty_onhand`,'-' AS `lot_number` from ((`products` join `product_categories` on((`products`.`category_id` = `product_categories`.`id`))) join `product_brands` on((`products`.`brand_id` = `product_brands`.`id`))) ;

-- ----------------------------
-- View structure for `view_orders`
-- ----------------------------
DROP VIEW IF EXISTS `view_orders`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_orders` AS select `purchase_orders`.`id` AS `id`,`purchase_orders`.`order_number` AS `order_number`,`purchase_orders`.`order_date` AS `order_date`,`purchase_orders`.`description` AS `description`,`vendors`.`name` AS `vendor_name` from (`purchase_orders` join `vendors` on((`vendors`.`id` = `purchase_orders`.`vendor_id`))) ;

-- ----------------------------
-- View structure for `view_product`
-- ----------------------------
DROP VIEW IF EXISTS `view_product`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_product` AS select `products`.`id` AS `id`,concat(`products`.`name`,' Qty : ',`products`.`qty_onhand`) AS `product_name` from `products` ;

-- ----------------------------
-- View structure for `view_product_items`
-- ----------------------------
DROP VIEW IF EXISTS `view_product_items`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_product_items` AS select `product_items`.`id` AS `id`,`product_items`.`product_id` AS `prod_id`,`products`.`name` AS `name`,`product_categories`.`name` AS `category_name`,`product_brands`.`name` AS `brand_name`,`vendors`.`name` AS `vendor_name`,`product_items`.`product_cost` AS `product_cost`,`product_items`.`product_price` AS `product_price`,`product_items`.`lot_number` AS `lot_number`,`product_items`.`qty` AS `qty` from ((((`product_items` join `products` on((`product_items`.`product_id` = `products`.`id`))) join `product_categories` on((`products`.`category_id` = `product_categories`.`id`))) join `product_brands` on((`products`.`brand_id` = `product_brands`.`id`))) join `vendors` on((`product_items`.`vendor_id` = `vendors`.`id`))) where (`product_items`.`qty` > 0) ;

-- ----------------------------
-- View structure for `view_product_location`
-- ----------------------------
DROP VIEW IF EXISTS `view_product_location`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_product_location` AS select `product_locations`.`id` AS `id`,`products`.`name` AS `name`,`product_locations`.`product_id` AS `product_id`,`product_locations`.`wh_location_id` AS `wh_location_id`,`wh_locations`.`wh_location_name` AS `wh_location_name`,`product_locations`.`qty_onhand` AS `qty_onhand`,`vendors`.`name` AS `vendor_name`,if((`product_locations`.`good_receipt_id` is not null),concat('Supplier : ',`vendors`.`name`,' Lokasi : ',convert(`wh_locations`.`wh_location_name` using utf8mb4),' Jumlah : ',`product_locations`.`qty_onhand`),concat('Supplier : No Receive, Lokasi : ',convert(`wh_locations`.`wh_location_name` using utf8mb4),' Jumlah : ',`product_locations`.`qty_onhand`)) AS `product_location` from ((((`product_locations` join `products` on((`products`.`id` = `product_locations`.`product_id`))) join `wh_locations` on((`wh_locations`.`id` = `product_locations`.`wh_location_id`))) left join `goods_receipt` on((`goods_receipt`.`id` = `product_locations`.`good_receipt_id`))) left join `vendors` on((`goods_receipt`.`vendor_id` = `vendors`.`id`))) ;

-- ----------------------------
-- View structure for `view_product_location_opname`
-- ----------------------------
DROP VIEW IF EXISTS `view_product_location_opname`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_product_location_opname` AS select `a`.`id` AS `id`,`b`.`name` AS `name` from (`product_locations` `a` join `products` `b` on((`b`.`id` = `a`.`product_id`))) ;

-- ----------------------------
-- Procedure structure for `sp_jurnal`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_jurnal`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_jurnal`(IN id INTEGER, type INTEGER)
BEGIN
SELECT trx.transaction_date as DATE, 
(CASE WHEN detail.credit != 0 THEN CONCAT('- ',account.account) ELSE account.account END)as DescriptionOrAccountTitle, 
detail.debit as AccountDebit,
detail.credit as AccountCredit,
trx.ref_no AS Reference,
(CASE WHEN detail.debit != 0 THEN 1 ELSE 2 END) as IsLine,
type.scope
FROM journal_transactions as trx
LEFT JOIN journal_details as detail ON (detail.journal_id = trx.id)
LEFT JOIN chart_of_accounts as account ON (detail.account_id = account.id)
LEFT JOIN transaction_types as type ON (trx.transaction_type = type.id)
WHERE trx.ref_id = id AND type.scope = type
ORDER BY Reference, IsLine;
END
;;
DELIMITER ;
